import React, { useState, useEffect } from "react";
import axios from "axios";
import * as XLSX from "xlsx";

export default function App() {
  const [fileData, setFileData] = useState([]);
  const [selectedFiles, setSelectedFiles] = useState([]);

  useEffect(() => {
    // Function to fetch data from the REST endpoint
    const fetchData = async () => {
      try {
        if (selectedFiles.length > 0) {
          const formData = new FormData();

          // Append all selected files to the FormData object
          for (const file of selectedFiles) {
            formData.append("my_audio_files", file);
          }

          const response = await axios.post(
            "http://localhost:8086/api/file_tempo",
            formData,
            {
              headers: {
                "Content-Type": "multipart/form-data",
              },
            }
          );

          setFileData((prevData) => [...prevData, ...response.data]);
        }
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, [selectedFiles]);

  const handleFileChange = (event) => {
    // Use the 'files' property to access selected files
    setSelectedFiles([...event.target.files]);
  };

  const exportToExcel = () => {
    const ws = XLSX.utils.json_to_sheet(fileData);
    const wb = XLSX.utils.book_new();
    XLSX.utils.book_append_sheet(wb, ws, "FileTempoData");
    XLSX.writeFile(wb, "file_tempo_data.xlsx");
  };

  return (
    <div className="App">
      <h1>File Tempo Data</h1>
      <input type="file" onChange={handleFileChange} multiple />
      <button onClick={exportToExcel}>Export to Excel</button>
      <table>
        <thead>
          <tr>
            <th>filename</th>
            <th>overall_tempo3</th>
            <th>peak_1</th>
            <th>peak_2</th>
          </tr>
        </thead>
        <tbody>
          {fileData.map((data, index) => (
            <tr key={index}>
              <td>{data.filename}</td>
              <td>{data.overall_tempo}</td>
              <td>{data.peak_1}</td>
              <td>{data.peak_2}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
